import React, { useEffect } from "react";

const ProjectText = () => {
  return (
    <div>

<p>Hi, I'm <span className="bold">Niels</span>,<br></br> I am Fullstack Software Developer that has just entered the Tech space. Passionate about coding, learning new skills, travelling and keeping myself fit and healthy. Would you like to know more about me? Check out my projects below, or reach out on my socials. 
</p>


    </div>
  );
};

export default ProjectText;
